import RAeWorkflow from "../../../assets/img/aw_ae_workflow.png";
import RSteamProfile from "../../../assets/img/aw_steam_profile.png";

export const initialState = {
    pageCaption: 'Предложи свою идею для создания композиции или зацени уже имеющиеся!',
    images: [
        {
            url: RAeWorkflow,
            title: 'Make a suggestion',
            rotate: '4',
            to: '/suggest',
        },
        {
            url: RSteamProfile,
            title: 'View compositions',
            width: '50%',
            rotate: '-9',
            to: '/compositions',
        },
    ]
}

function homeReducer(state = initialState, {type, payload = null}) {
    switch (type) {
        case '':
            return {...state,}

        default:
            return state
    }
}

export default homeReducer
